import java.util.*;


public class Part2 {

	public static void main(String[] args) {
		String str = "";

		int numUnique = 14;
		for (int i = 0; i <= str.length() - numUnique; i += 1) {
			String substr = str.substring(i, i + numUnique);
			Set<Character> set = new HashSet<>();
			for (char c : substr.toCharArray())
				set.add(c);
			if (set.size() == numUnique) {
				System.out.println("ANSWER: " + (i + numUnique));
				return;
			}
		}
	}

}
